          //
          //   IPv6v4-comp    = [IPv6-hex *3(":" IPv6-hex)] "::"
          //                  [IPv6-hex *3(":" IPv6-hex) ":"]
          //                  IPv4-address-literal
          //                  ; The "::" represents at least 2 16-bit groups of
          //                  ; zeros.  No more than 4 groups in addition to the
          //                  ; "::" and IPv4-address-literal may be present.
          //
